INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCFS', 'STOCK', 'FirstCash Holdings, Inc.', 'NMS', 'Financial Services', 'Credit Services', 'FirstCash Holdings, Inc. is an operator of pawn stores in the United States and Latin America. The Company is a provider of technology-driven, retail point-of-sale (POS) payment solutions focused on serving cash and credit-constrained consumers in the U.S. and Puerto Rico. It operates two business lines: pawn operations and retail POS payment solutions, which are organized into three reportable segments. The U.S. pawn segment consists of pawn operations in 29 U.S. states and the District of Columbia, while the Latin America pawn segment consists of pawn operations in Mexico, Guatemala, Colombia and El Salvador. The retail POS payment solutions segment consists of the operations of American First Finance, LLC (AFF) in all 50 states in the U.S., the District of Columbia and Puerto Rico. Its pawn stores buy and sell a variety of jewelry, electronics, appliances, sporting goods, musical instruments and other merchandise, and help customers in providing small non-recourse pawn loans.', 'Fort Worth, TX, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPWK', 'STOCK', 'EPWK Holdings Ltd.', 'NGM', 'Technology', 'Software - Application', 'EPWK Holdings Ltd is a holding company that is primarily engaged in providing services to businesses. The Company has created a cloud procurement platform that connects businesses with outstanding talent. The Company''s platform users include buyers seeking working talent and sellers offering different talents and skills. The Company operates three segments: the Online Promotion, the Shared Office Rental and the Value-added Service. The Company provides a variety of services to businesses of all sizes, including creative design, visual design, e-commerce design, development services, industrial design, marketing copywriting, and others.', 'Xiamen, , China', 184);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OIS', 'STOCK', 'Oil States International, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Oil States International, Inc. is a global provider of manufactured products and services to customers in the energy, industrial and military sectors. The Company''s manufactured products include highly engineered capital equipment and consumable products. It segments include Offshore Manufactured Products, Completion and Production Services, and Downhole Technologies. The Offshore Manufactured Products segment designs, manufactures and markets capital equipment utilized on floating production systems, subsea pipeline infrastructure, and offshore drilling rigs and vessels, along with short-cycle and other products. The Completion and Production Services segment includes a range of equipment and services used to establish and maintain the flow of oil and natural gas from a well throughout its life cycle. The Downhole Technologies segment provides oil and gas perforation systems and downhole tools in support of completion, intervention, wireline and well abandonment operations.', 'Houston, TX, United States', 2439);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHRD', 'STOCK', 'Chord Energy Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'Chord Energy Corporation is an independent exploration and production company, which is engaged in the acquisition, exploration, development and production of crude oil, natural gas liquids (NGL) and natural gas primarily in the Williston Basin. The Companys operations are focused on the North Dakota and Montana areas of the Williston Basin, targeting the Middle Bakken and Three Forks formations, which are present across a substantial portion of its acreage. The Company has an average daily production of approximately 232,737 net barrels of oil equivalent per day (Boepd). It has approximately 9,011 (4,174.2 net) total gross productive wells, of which 4,824 gross (3,752.2 net) productive wells were operated by the Company. The Company sells its crude oil, NGL and natural gas production to refiners, marketers and other purchasers that have access to nearby pipeline and rail facilities.', 'Houston, TX, United States', 762);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATRC', 'STOCK', 'AtriCure, Inc.', 'NGM', 'Healthcare', 'Medical Instruments & Supplies', 'AtriCure, Inc. provides technologies for the treatment for atrial fibrillation (Afib), left atrial appendage (LAA) management and post-operative pain management. The Company''s cardiac ablation and left atrial appendage management (LAAM) products are used by physicians during open-heart and minimally invasive surgical procedures. Its pain management solutions are used by physicians to freeze nerves during cardiothoracic or thoracic surgical procedures. The Company''s products for open and minimally invasive ablation include Isolator Synergy Clamps and Multifunctional Pens and Linear Ablation Devices. Its products for open ablation include cryoICE Cryoablation System. Its products for minimally invasive ablation include EPi-Sense Guided Coagulation System with VisiTrax Technology. Its appendage management products include AtriClip System. The Isolator Synergy Ablation System clamps are single-use disposable radio frequency (RF) products with jaws that close in a parallel fashion.', 'Mason, OH, United States', 1300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DPZ', 'STOCK', 'Domino''s Pizza, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'A Domino''s Pizza, Inc. É uma empresa de pizza com um negócio significativo tanto na entrega como no transporte. A empresa opera através de três segmentos: Lojas dos EUA, franquia internacional e cadeia de suprimentos. O segmento de lojas dos EUA é composto principalmente de suas operações de franquia, que consiste em lojas franchisadas localizadas nos Estados Unidos. O segmento também opera uma rede de lojas próprias da United States Company. O segmento de franquia internacional inclui principalmente operações relacionadas ao negócio de franchising da Companhia em mercados estrangeiros. O segmento da cadeia de suprimentos inclui principalmente a distribuição de alimentos, equipamentos e suprimentos para lojas a partir das operações do centro da cadeia de suprimentos da Companhia nos Estados Unidos e no Canadá. É principalmente um franqueador, com aproximadamente 99% de suas lojas globais de propriedade e operação por seus franqueados independentes. Em seus mercados internacionais, a e', 'Ann Arbor, MI, United States', 6400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WEX', 'STOCK', 'WEX Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'A WEX Inc. Fornece uma plataforma de comércio global, que possui e opera um ecossistema business-to-business (B2B). A Companhia atua por meio de três segmentos: Mobilidade, Benefícios e Pagamentos Corporativos. Seu segmento de Mobilidade fornece serviços de processamento de pagamentos, processamento de transações e gerenciamento de informações especificamente projetados para as necessidades de frotas de todos os tamanhos, desde pequenas empresas até frotas governamentais federais e estaduais e transportadores rodoviários. Seu segmento de benefícios fornece uma plataforma de Software como serviço (SaaS) para benefícios de saúde direcionados ao consumidor e uma solução de inscrição de benefícios de serviço completo, reunindo administração de benefícios, determinados serviços de conformidade e contas direcionadas ao consumidor e de benefícios. Seu segmento de Pagamentos Corporativos se concentra no complexo ambiente de pagamentos de B2B globais, permitindo que os clientes utilizem suas so', 'Portland, ME, United States', 6500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWBC', 'STOCK', 'East West Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'East West Bancorp, Inc. is a bank holding company that offers a full range of banking services to individuals and businesses through its subsidiary bank, East West Bank (the Bank). Its segments include Consumer and Business Banking, Commercial Banking, and Treasury and Other. The Consumer and Business Banking segment provides financial products and services to consumer and commercial customers through its domestic branch network and digital banking platforms. This segment also offers consumer and commercial deposits, mortgage and home equity loans, and other products and services. The Commercial Banking segment generates commercial loans and deposits. Commercial loan products include construction finance, commercial business lending, working capital lines of credit, trade finance, letters of credit, and others. Commercial deposit products and other financial services include treasury management, foreign exchange services, interest rate, and commodity risk hedging.', 'Pasadena, CA, United States', 3100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIFF', 'STOCK', 'Firefly Neuroscience, Inc.', 'NCM', 'Technology', 'Software - Application', 'Firefly Neuroscience, Inc. is an artificial intelligence (AI) technology company developing neuroscientific solutions to improve brain health outcomes for patients with mental illnesses and neurological disorders. The Company has developed its FDA-510(k) cleared Brain Network Analytics software platform (the BNA Platform) and is focused on advancing diagnostic and treatment approaches for people suffering from mental illnesses and cognitive disorders, including depression, dementia, anxiety disorders, concussions, and attention-deficit/hyperactivity disorder. The Company''s Brain Network Analytics is a neurophysiological assessment tool that uses artificial intelligence and machine learning to analyze electroencephalogram (EEG) data recorded during rest and cognitive activity. The BNA Platform, in conjunction with an EEG system, provides clinicians with comprehensive insights into brain function (cognition).', 'Kenmore, NY, United States', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMBM', 'STOCK', 'Cambium Networks Corporation', 'NGM', 'Technology', 'Communication Equipment', 'Cambium Networks Corporation is a provider of wireless networking infrastructure solutions. The Company enables service providers, enterprises, industrial organizations, and governments to deliver digital experiences and device connectivity. Its ONE Network platform simplifies management of its wired and wireless broadband and network edge technologies. It designs, develops, and manufactures wireless broadband and Wi-Fi networking infrastructure solutions for a range of applications, including broadband access, wireless backhaul, Internet of Things (IoT), public safety, and others. Its Fixed Wireless Broadband portfolio spans point-to-point (PTP) and point-to-multi-point (PMP) architectures over multiple standards. Its Enterprise portfolio includes Wi-Fi access points, wireless aware switches, security gateways and other networking devices. Its Subscription and Services portfolio includes network planning and design as well as cloud or on-premises network management and control.', 'Hoffman Estates, IL, United States', 625);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CALX', 'STOCK', 'Calix, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'Calix, Inc. is an appliance-based platform, cloud and managed services company. It develops, markets, and sells its appliance-based platform, cloud and managed services that enable service providers of all types and sizes to transform their businesses. Its Calix Platform consists of Calix Cloud, which comes in three role-based editions: Calix Engagement Cloud, Calix Operations Cloud and Calix Service Cloud; Calix Intelligent Access, its network solution for automated, intelligent next-generation networks, and Calix Unlimited Subscriber, its premises solution for subscriber managed services. Its SmartLife managed services consist of SmartHome managed services and applications to enhance, operate and secure the connected experience of subscribers in their home; SmartBiz managed services address the business networking and productivity needs of small business owners, and SmartMDU managed services, which provide purpose-built, flexible connectivity solutions for multifamily properties.', 'San Jose, CA, United States', 1820);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURI', 'STOCK', 'CuriosityStream Inc.', 'NCM', 'Communication Services', 'Broadcasting', 'CuriosityStream Inc. is a media and entertainment company that offers video and audio programming across the principal categories of factual entertainment, including science, history, society, nature, lifestyle and technology. The Company provides factual entertainment that informs, enchants and inspires. It provides advertising and sponsorships services through developing integrated digital brand partnerships designed to offer the chance to be associated with CuriosityStream content in a variety of forms, including short- and long-form program integration; branded social media promotional videos; broadcast advertising spots in its video and audio programs that are made available on its linear programming channels or in front of the paywall; and its increasing focus on digital display ads while delivering its content through advertising-based video-on-demand, transactional video-on-demand, free advertising-supported streaming television, YouTube and other similar distribution channels.', 'Silver Spring, MD, United States', 45);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDD', 'STOCK', 'Morgan Stanley Emerging Markets Domestic Debt Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Morgan Stanley Emerging Markets Domestic Debt Fund, Inc. is a closed ended fixed income mutual fund launched and managed by Morgan Stanley Investment Management Inc. The fund invests in fixed income markets of emerging market countries across the globe. It typically invests in government bonds denominated in the local currencies of emerging markets. The fund benchmarks the performance of its portfolio against the JPMorgan Government Bond Index - Emerging Markets Global Diversified Index. Morgan Stanley Emerging Markets Domestic Debt Fund, Inc. was formed on January 25, 2007 and is domiciled in United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURV', 'STOCK', 'Torrid Holdings Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Torrid Holdings Inc. is a direct-to-consumer brand of apparel, intimates, and accessories in North America. The Company is focused on fit and offers products across a broad assortment, which includes tops, bottoms, denim, dresses, intimates, activewear, footwear and accessories. It designs, develops and merchandises almost all of its products in-house, under the Torrid, Torrid Curve, CURV and Lovesick brand names. The Company operates in one segment, being the operation of its e-commerce platform and stores. Through its unified commerce platform, which includes its e-commerce and retail stores, it delivers a brand experience to its customers. Its e-commerce channel is central to its unified commerce platform. Its Website and mobile app feature updates on new collections and guidance on how to wear and put together outfits. It operates approximately 634 stores in the United States, Puerto Rico and Canada. Its stores are located in malls, shopping plazas, and lifestyle centers.', 'City Of Industry, CA, United States', 1810);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIGI', 'STOCK', 'Colliers International Group Inc.', 'NMS', 'Real Estate', 'Real Estate Services', 'Colliers International Group Inc. is a global diversified professional services and investment management company. The Company''s platforms include commercial real estate services, engineering consultancy and investment management. Its service lines are outsourcing, engineering, investment management, leasing and capital markets. Its services for landlords and investors include landlord representation, project management, capital market, valuation and advisory, real estate management, engineering and design services, and others. Its services for occupiers and tenants include occupier services, tenant representation, project management, technology services and others. It offers services to various properties-including hospitality, industrial, land, multifamily, office, retail, healthcare and special purpose. Harrison Street Asset Management (Harrison Street) offers solutions across a variety of closed-end, open-end and specialized vehicles.', 'Toronto, ON, Canada', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRNX', 'STOCK', 'Crinetics Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Crinetics Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company focused on the discovery, development and commercialization of therapeutics for rare endocrine diseases and endocrine-related tumors. Its lead development candidate, PALSONIFY (paltusotine), is the first investigational once-daily, oral, selective somatostatin receptor type 2 (SST2) nonpeptide agonist that is in clinical development for acromegaly and carcinoid syndrome associated with neuroendocrine tumors. Its second product candidate is Atumelnant, which is in clinical development for congenital adrenal hyperplasia (CAH) and patients with either Cushing''s disease or Ectopic ACTH Syndrome (EAS). Its drug candidates are orally delivered, small molecule new chemical entities resulting from in-house drug discovery efforts, including other programs addressing a variety of endocrine conditions such as hyperparathyroidism, polycystic kidney disease, Graves'' disease, thyroid eye disease, diabetes and obesity.', 'San Diego, CA, United States', 437);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGCO', 'STOCK', 'AGCO Corporation', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'AGCO Corporation designs, manufactures and distributes agricultural machinery and precision agriculture technology. The Companys brands include Fendt, Massey Ferguson, PTx and Valtra. Its segments include North America, South America, Europe/Middle East and Asia/Pacific/Africa regions. Its solutions include tractors, compact/utility tractors, harvesting, hay & forage, crop care & nutrient management, planting & soil preparation, material handling, power generation, water management, and engines. Its tractors include high horsepower tractors, utility or mid-range tractors, and compact tractors. Its hay and forage solutions range from mowers and balers to forage blowers. It offers seeding and tillage equipment for a variety of crops and conditions - from minimum tillage to primary tillage. Its AGCO Power division produces diesel engines, gears and generating sets. It also provides retail and wholesale financing through its finance joint ventures with Cooperatieve Rabobank U.A.', 'Duluth, GA, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCR', 'STOCK', 'Invesco BulletShares 2027 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in the securities that comprise the underlying index. Strictly in accordance with its guidelines and mandated procedures, Invesco Indexing LLC compiles and maintains the underlying index. The index provider is affiliated with Invesco Capital Management LLC, the fund’s investment adviser (the “Adviser”), and Invesco Distributors, Inc., the fund’s distributor.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKRO', 'STOCK', 'Akero Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Akero Therapeutics, Inc. is a clinical-stage company developing transformational treatments for patients with serious metabolic diseases marked by high unmet medical need, including metabolic dysfunction-associated steatohepatitis (MASH). Efruxifermin (EFX), its lead product candidate for MASH, is being evaluated in three ongoing Phase 3 studies: SYNCHRONY Outcomes in patients with compensated cirrhosis (F4) due to MASH, SYNCHRONY Histology in patients with pre-cirrhotic (F2-F3 fibrosis) MASH, and SYNCHRONY Real-World in patients with MASH (F1-F4). The Phase 3 SYNCHRONY program builds on the results of two Phase 2b clinical trials, the HARMONY study in patients with pre-cirrhotic MASH and the SYMMETRY study in patients with compensated cirrhosis due to MASH. EFX is an analog of fibroblast growth factor 21 (FGF21), which is an endogenously expressed hormone that protects against cellular stress and regulates metabolism of lipids, carbohydrates and proteins throughout the body.', 'South San Francisco, CA, United States', 67);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESNT', 'STOCK', 'Essent Group Ltd.', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'Essent Group Ltd. is a Bermuda-based holding company. The Company, through its wholly owned subsidiaries, offers private mortgage insurance and reinsurance, and title insurance and settlement services to serve the housing finance industry. Through the subsidiary, CUW Solutions, LLC, it offers mortgage insurance and provides contract underwriting services on a limited basis. It also offers mortgage-related insurance and reinsurance through its Bermuda-based subsidiary, Essent Reinsurance Ltd. The Company provides private capital to mitigate mortgage credit risk, allowing lenders to make additional mortgage financing available to prospective homeowners. Its products and services include Bermuda-Based Insurance and Reinsurance, Title Insurance and Settlement Services, Mortgage Insurance, and Contract Underwriting. It offers two types of private mortgage insurance, namely primary and pool. Its subsidiaries include Essent Reinsurance Ltd. and Essent Irish Intermediate Holdings Ltd.', 'Hamilton, , Bermuda', 521);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBR', 'STOCK', 'Amber International Holding Limited', 'NGM', 'Technology', 'Software - Infrastructure', 'Amber International Holding Limited operates under the brand name Amber Premium. Amber Premium is a provider of institutional crypto financial services and solutions. A subsidiary of Amber Group, Amber Premium delivers institutional-grade market access, execution infrastructure, and investment solutions to help institutions and high-net-worth individuals optimize their digital asset portfolios. The Company offers a regulated, scalable financial ecosystem powered by proprietary blockchain and financial technologies, artificial intelligence (AI)-driven risk management, and quantitative algorithms across CeFi, DeFi, and OTC markets. Its core product offerings include Frictionless Fiat On/Off Ramp Services, over the counter (OTC) Trading and Execution Services, Standard Earn/Structured Products, DeFi Yield Enhance Products, Strategic Funds, and Other Services. The Company provides fiat on/off ramp services that offer clients a gateway into the digital assets ecosystem.', 'Singapore, , Singapore', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABG', 'STOCK', 'Asbury Automotive Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Asbury Automotive Group, Inc. is an automotive retailer. The Company operates through two segments: Dealerships and Total Care Auto (TCA). The Company offers a range of automotive products and services fulfilling the entire vehicle ownership lifecycle, including new and used vehicles, parts and services, which include vehicle repair and maintenance services, replacement parts and collision repair services, and finance and insurance (F&I) products, including arranging vehicle financing through third parties and aftermarket products, such as extended service contracts, guaranteed asset protection debt cancellation and prepaid maintenance plans. The Company operates approximately 178 new-vehicle dealerships, consisting of over 241 franchises and representing 31 domestic and foreign brands of vehicles. It also operates Total Care Auto, Powered by Landcar, a provider of service contracts and other vehicle protection products, and 40 collision repair centers.', 'Duluth, GA, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MVLL', 'STOCK', 'GraniteShares 2x Long MRVL Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change the underlying stock by entering into financial instruments such as swaps and options underlying stock as well as directly purchasing the underlying stock. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMX', 'STOCK', 'EMX Royalty Corporation', 'ASE', 'Basic Materials', 'Other Industrial Metals & Mining', 'EMX Royalty Corporation is a precious and base metals royalty company. It is in the business of acquisition and management of royalties, strategic investments, and organically generating royalties derived from a portfolio of mineral property interests. Its royalty and exploration portfolio consists of properties in North America, Europe, Turkiye, Latin America, Morocco and Australia. Its diversified portfolio of royalty, mineral property and investment interests spans six continents, and is focused on gold, copper, and polymetallic assets. Its royalties include Leeville, Kwai, Lang Lake, Lucky 7, Manitou, McDonough, Pipestone, Red Lake Gold - Gullrock Lake, Red Lake Gold - Duchess, Red Lake Gold - Tilly, South of Otter, Portage River, Colla Kananchiari, Grand Bois & Surrounding Properties, San Agustin Sulfides, Jasikovo East-Durlan Potok, Gediktepe Oxide / Sulfide, Goodpaster - 64 North, South Orogrande, Gold Bar South - Afgan, Maggie Creek South, Yerington West-Roulette, and others.', 'Vancouver, BC, Canada', 49);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EUFN', 'STOCK', 'iShares MSCI Europe Financials ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The index is a free float-adjusted market capitalization-weighted index designed to measure the combined equity market performance of the financials sector of developed market countries in Europe.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHEF', 'STOCK', 'The Chefs'' Warehouse, Inc.', 'NMS', 'Consumer Defensive', 'Food Distribution', 'The Chefs'' Warehouse, Inc. is a distributor of specialty food products in the United States, the Middle East, and Canada. The Company offers stock-keeping units (SKUs), ranging from specialty foods and ingredients to basic ingredients and staples, produce and center-of-the-plate proteins. Its product categories include center-of-the-plate, dry goods, pastry, cheeses and charcuterie, produce, dairy and eggs, oils and vinegars and kitchen supplies. It operates through the foodservice distribution segment, which is concentrated primarily in the United States. The Companys customer base consists primarily of menu-driven independent restaurants, fine dining establishments, country clubs, hotels, caterers, culinary schools, bakeries, patisseries, chocolateries, cruise lines, casinos and specialty food stores. Its center-of-the-plate products include custom cut beef, seafood and hormone-free poultry, as well as produce and food products, such as cooking oils, butter, eggs, milk, and flour.', 'Ridgefield, CT, United States', 5029);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVBF', 'STOCK', 'CVB Financial Corp.', 'NMS', 'Financial Services', 'Banks - Regional', 'CVB Financial Corp. is the bank holding company for Citizens Business Bank (the Bank). The Bank offers an array of banking, lending and investing services with more than 60 banking centers and three trust office locations serving California. It offers a range of bank deposit instruments, which include checking, savings, money market and time certificates of deposit for both business and personal accounts, municipalities and districts, and specialized deposit products for title and escrow. It provides a full complement of lending products, including commercial, agribusiness, consumer, small business administration (SBA), real estate, and construction loans, as well as equipment and vehicle leasing. It also offers a range of specialized services designed for the needs of its commercial customers. In addition, it offers a range of financial services and trust services through its CitizensTrust division, which includes fiduciary services, mutual funds, annuities, 401(k) plans and others.', 'Ontario, CA, United States', 1089);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGRW', 'STOCK', 'WisdomTree U.S. Quality Dividend Growth Fund', 'NGM', NULL, NULL, 'Under normal circumstances, at least 80% of the fund''s total assets (exclusive of collateral held from securities lending) will be invested in constituent securities of the index and investments that have economic characteristics that are substantially identical to the economic characteristics of such constituent securities. The index is a fundamentally weighted index that consists of dividend-paying U.S. common stocks with growth characteristics. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTXR', 'STOCK', 'Citius Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Citius Pharmaceuticals, Inc. is a biopharmaceutical company focused on the development and commercialization of first-in-class critical care products, with a pipeline of anti-infectives in oncology, adjunct cancer care, stem cell therapy and prescription products. The Company''s FDA approved LYMPHIR candidate is a targeted immunotherapy for an initial indication in the treatment of cutaneous T-cell lymphoma. Its late-stage pipeline also includes Mino-Lok, and CITI-002 (Halo-Lido). Mino-Lok is an antibiotic lock solution used to treat patients with catheter-related bloodstream infections (CRBSIs) and central line associated bloodstream infections (CLABSIs). Halo-Lido is a topical formulation of halobetasol propionate, a corticosteroid, and lidocaine that is intended for the treatment of hemorrhoids. The Company is also seeking to develop and commercialize the NoveCite mesenchymal stem cells (NC-iMSCs) to treat acute respiratory conditions with a near term focus on ARDS.', 'Cranford, NJ, United States', 23);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDW', 'STOCK', 'CDW Corporation', 'NMS', 'Technology', 'Information Technology Services', 'A CDW Corporation é uma fornecedora multimarca de soluções de tecnologia da informação (TI) para clientes empresariais, governamentais, educacionais e de saúde nos Estados Unidos, Reino Unido e Canadá. A variedade de ofertas da empresa varia de produtos discretos de hardware e software a soluções e serviços integrados DE TI que incluem recursos locais e de nuvem em infraestrutura híbrida, experiência digital e segurança. A Companhia atua por meio de três segmentos: Corporativo, Pequenas Empresas e Público. O segmento corporativo atende principalmente clientes empresariais do setor privado dos Estados Unidos. O segmento de Pequenas Empresas atende principalmente clientes empresariais do setor privado dos Estados Unidos. O segmento Público é composto por agências governamentais e instituições de educação e saúde nos Estados Unidos. As soluções da empresa são entregues em ambientes físicos, virtuais e baseados na nuvem. A empresa fornece soluções integradas DE TI em mais de 150 países.', 'Vernon Hills, IL, United States', 15100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGBD', 'STOCK', 'Carlyle Secured Lending, Inc.', 'NMS', 'Financial Services', 'Asset Management', 'Carlyle Secured Lending, Inc. is a specialty finance company that is a closed-end, externally managed, non-diversified management investment company. The Company''s investment objective is to generate current income and capital appreciation primarily through assembling a portfolio of secured debt investments in United States middle market companies. The Company seeks to achieve its investment objective primarily through direct origination of secured debt instruments, including first lien senior secured loans (which may include stand-alone first lien loans, first lien/last out loans and unitranche loans) and second lien senior secured loans (collectively, Middle Market Senior Loans), with a minority of its assets invested in higher yielding investments (which may include unsecured debt, subordinated debt and investments in equities and structured products). The Company is externally managed by its investment adviser, Carlyle Global Credit Investment Management L.L.C.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHDN', 'STOCK', 'Churchill Downs Incorporated', 'NMS', 'Consumer Cyclical', 'Gambling', 'Churchill Downs Incorporated é uma empresa de entretenimento de jogos e apostas online, que está ancorada pelo seu principal evento, o Kentucky Derby. A empresa opera através de três segmentos portáteis: Live e Historical Racing, Serviços e Soluções de Aposta e Jogos. O segmento Live and Historical Racing inclui corridas de pari-mutuel ao vivo e histórico no Churchill Downs Racetrack e suas propriedades de corrida históricas em Kentucky, Virgínia e New Hampshire. O segmento de Serviços e Soluções de Aposta inclui TwinSpires, que é um negócio de apostas esportivas online e de varejo; United Tote Company, que fabrica e opera sistemas de apostas pari-mutuel para pistas de corrida, instalações de apostas off-track (OTB) e outros negócios de apostas pari-mutuel; e Exacta Systems, LLC que fornece tecnologia de sistema determinante central em máquinas de corrida históricas (HRMS) em todo o país. O segmento Gaming está envolvido nas propriedades do cassino e nas instalações associadas de pista', 'Louisville, KY, United States', 6480);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYRN', 'STOCK', 'Byrna Technologies Inc.', 'NCM', 'Industrials', 'Aerospace & Defense', 'Byrna Technologies Inc. is a technology company specializing in the development, manufacture, and sale of less-lethal personal security solutions. The Company is the manufacturer of the Byrna SD personal security device, a handheld carbon dioxide (CO2) powered launcher designed to provide a less-lethal alternative to a firearm for the consumer, private security, and law enforcement markets. The Companys product portfolio includes handheld personal security devices and shoulder-fired launchers designed for use by consumers and professional security customers without the need for a background check or firearms license; a line of projectiles that are fired by Byrna devices, including chemical irritant, kinetic and inert rounds; a line of self-defense aerosol products, including Byrna Bad Guy Repellent; and accessories and related safety products, including the Byrna Banshee, Byrna Shield, compressed CO2 canisters, sighting systems, holsters and Byrna-branded apparel.', 'Andover, MA, United States', 167);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AACG', 'STOCK', 'ATA Creativity Global', 'NCM', 'Consumer Defensive', 'Education & Training Services', 'ATA Creativity Global (ATA) is a China-based company mainly providing international educational services. The Company''s main businesses include providing international educational experiences related to the cultivation and improvement of students'' creativity. The Company''s principal product and service are portfolio training services which it provide to students in China who are interested in studying art overseas.', 'Hefei, , China', 599);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMC', 'STOCK', 'Commercial Metals Company', 'NYQ', 'Basic Materials', 'Steel', 'Commercial Metals Company is engaged in offering products and technologies to meet the critical reinforcement needs of the global construction sector. The Companys solutions support construction across a wide variety of applications, including infrastructure, non-residential, residential, industrial, and energy generation, and transmission. Its segments include North America Steel Group, Europe Steel Group and the Emerging Businesses Group. The North America Steel Group segment provides a diverse offering of products and solutions to support the construction sector. The Europe Steel Group segment is composed of a vertically integrated network of recycling facilities, an EAF mini mill and fabrication operations located in Poland. The Emerging Businesses Group segment''s portfolio consists of its construction services products, Tensar products and solutions and its impact metals, and performance reinforcing steel products.', 'Irving, TX, United States', 13178);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXG', 'STOCK', 'Eaton Vance Tax-Managed Global Diversified Equity Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance Tax-Managed Global Diversified Equity Income Fund is a closed-ended equity mutual fund launched and managed by Eaton Vance Management. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in dividend paying stocks of companies. The fund also invests through derivatives. It also writes call options on one or more U.S. and foreign indices with respect to a portion of the value of its common stock portfolio. The fund benchmarks the performance of its portfolio against the MSCI World Index. Eaton Vance Tax-Managed Global Diversified Equity Income Fund was formed on February 27, 2007 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTOS', 'STOCK', 'Custom Truck One Source, Inc.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Custom Truck One Source, Inc. is a provider of specialty equipment, parts, tools, accessories and services to the electric utility transmission and distribution, telecommunications and rail markets in North America. The Companys segments include Equipment Rental Solutions (ERS), Truck and Equipment Sales (TES)and Aftermarket Parts and Services. The ERS segment owns a range of new and used specialty equipment, including truck-mounted aerial lifts, cranes, service trucks, dump trucks, trailers, digger derricks and other machinery and equipment. The TES segment consists of the production and sale of new and used specialty equipment and vocational trucks, which includes equipment from original equipment manufacturers (OEMs) across its end-markets, as well as its Load King brand. The APS segment includes the sale of specialized aftermarket parts, including captive parts related to its Load King brand, used in the maintenance and repair of the equipment it sells and rents.', 'Kansas City, MO, United States', 2619);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACLS', 'STOCK', 'Axcelis Technologies, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Axcelis Technologies, Inc. provides high-productivity solutions for the semiconductor industry. The Company is focused on developing enabling process applications through the design, manufacture and complete life cycle support of ion implantation systems, one of the critical and enabling steps in the IC manufacturing process. Its ion implantation products include high current ion implant, high energy ion implant and medium current ion implant. The Company''s Purion H, Purion Dragon, Purion H200, and GSD/E2 Ovation spot beam, high current systems cover all traditional high current requirements as well as those associated with emerging and future devices. Its Purion XE, EXE, and other Purion high energy systems combine its production-proven RF Linac high energy, spot beam technology with the Purion platform wafer handling system. Its medium current ion implant products include its Purion M Si and SiC medium current systems. It also offers its customers aftermarket service and support.', 'Beverly, MA, United States', 1524);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATAT', 'STOCK', 'Atour Lifestyle Holdings Limited', 'NMS', 'Consumer Cyclical', 'Lodging', 'Atour Lifestyle Holdings Ltd is principally engaged in the hotel operations. The Company''s hotel network has approximately 834 hotels located across 151 cities in China, with more than 96,969 hotel rooms. The Company also has approximately 17 theme-based hotels, which includes music, basketball and literature themes. The Company provides a diversified hotel brand portfolio, including Atour, Atour S, Atour X, Atour Light, ZHOTEL and A.T. House. The Company also rents hotels to third-party lessors.', 'Shanghai, , China', 5488);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRI', 'STOCK', 'Centuri Holdings, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Centuri Holdings, Inc. is a utility infrastructure services company that partners with regulated utilities to build and maintain the energy network that powers millions of homes and businesses across the United States and Canada. The Company''s segments include U.S. Gas Utility Services (U.S. Gas), Canadian Gas Utility Services (Canadian Gas), Union Electric Utility Services (Union Electric), and Non-Union Electric Utility Services (Non-Union Electric). The U.S. Gas and Canadian Gas segments provide comprehensive services, including maintenance, replacement, repair and installation for local natural gas distribution utilities (LDCs) focused on the modernization of customers infrastructure throughout the United States and Canada. The Union Electric segment provides a comprehensive set of electric utility services encompassing maintenance, replacement, repair, upgrade and expansion services for urban transmission and local distribution infrastructure within union markets.', 'Phoenix, AZ, United States', 8687);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FA', 'STOCK', 'First Advantage Corporation', 'NMS', 'Industrials', 'Specialty Business Services', 'First Advantage Corporation is a global provider of employment background screening, identity, and verification solutions. Enabled by its technology, the Company delivers services and insights that help customers mitigate risk and hire talent: employees, contractors, contingent workers, tenants, and drivers. Its comprehensive product suite enables its customers across all industry sectors to perform pre-onboarding screening and post-onboarding monitoring of employees, contractors, contingent workers, tenants, and drivers. Its pre-onboarding products include criminal background checks, drug/health screening, extended workforce screening, FBI channeling, identity checks and biometric fraud mitigation tools, education/work history verification, driver records and compliance, healthcare credentials, executive screening and others. Its post-onboarding solutions include criminal records monitoring, healthcare sanctions, motor vehicle records, social media and global sanctions and licenses.', 'Atlanta, GA, United States', 10000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DARE', 'STOCK', 'Daré Bioscience, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dare Bioscience, Inc. is a biopharmaceutical company. The Company''s programs target unmet needs in women''s health, primarily in the areas of contraception, sexual health, pelvic pain, fertility, infectious disease, vaginal health and menopause. Its product includes XACIATO (clindamycin phosphate) vaginal gel 2%. XACIATO is a single-dose prescription medication for the treatment of bacterial vaginosis in females 12 years of age and older. Its other product candidates include Ovaprene, Sildenafil Cream, and DARE-HRT1. Ovaprene is an investigational, hormone-free, monthly intravaginal contraceptive. Sildenafil Cream is a novel cream formulation of sildenafil for the treatment of female sexual arousal disorder; and DARE-HRT1 is an intravaginal ring designed to deliver a combination of menopausal hormone therapy, bio-identical 17b-estradiol and progesterone together, continuously over a 28-day period for the treatment of moderate to severe vasomotor symptoms, also known as hot flashes.', 'San Diego, CA, United States', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBZ', 'STOCK', 'CBIZ, Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'CBIZ, Inc. is a professional services advisor to middle-market businesses and organizations nationwide. It provides a range of accounting, tax, advisory, benefits, insurance, and technology services. It delivers its services through three groups: Financial Services, Benefits and Insurance Services, and National Practices. Financial Services is comprised of traditional accounting services, tax return preparation, administrative services, financial and risk advisory, consulting, valuation, and IT services. Benefits and Insurance Services provides brokerage and consulting along lines of service which include group health benefits consulting and brokerage, property and casualty brokerage, retirement plan advisory, payroll, human capital management, actuarial, life insurance, and other services. National Practices provides managed networking and hardware services consisting of installation, maintenance and repair of computer hardware. It also maintains a cyber risk management program.', 'Independence, OH, United States', 10000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CORT', 'STOCK', 'Corcept Therapeutics Incorporated', 'NCM', 'Healthcare', 'Biotechnology', 'Corcept Therapeutics Incorporated is a commercial-stage company. The Company is engaged in the discovery and development of medications to treat severe endocrinologic, oncologic, metabolic and neurologic disorders by modulating the effects of the hormone cortisol. The Company operates through the discovery, development and commercialization of the pharmaceutical products segment. The Company has marketed Korlym (mifepristone) in the United States for the treatment of patients suffering from Cushings syndrome. The Companys portfolio of selective cortisol modulators consists of four series totaling approximately 1,000 compounds. Its portfolio of selective cortisol modulators consists of relacorilant, dazucorilant and miricorilant. Korlyms active ingredient, mifepristone, reduces the binding of excess cortisol to the GR, it can modulate the effects of abnormal levels and release patterns of cortisol without compromising cortisols healthy functions and rhythms.', 'Redwood City, CA, United States', 500);\n